const TourCard = ({ tour }) => {
  const { id, title, photo, price, featured, avgRating, reviews } = tour;

  return (
    <div className="tour__card">
      <Card>
        <div className="tour__img"></div>
      </Card>
    </div>
  );
};

export default TourCard;
